import React from "react";
import "./App.css";
import { Route, BrowserRouter, Link, Outlet } from "react-router-dom";

// TODO:
// Animation of all the text
// Use flex container for all the route buttons
// Add route pages
// Add style for buttons

function App() {
  return (
    <BrowserRouter>
      <Route path="/">
        <Route path="/Restaurants" component={<Restaurant />}></Route>
      </Route>
    </BrowserRouter>
  );
}

const Restaurant = () => (
  <div>
    <h2>Restaurants</h2>
  </div>
);

const Layout = () => {
  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/blogs">Blogs</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
      </nav>

      <Outlet />
    </>
  )
};


export default App;
